import React, { useState } from 'react';

function Navbar({ smoothScroll }) {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <nav className="nav" id="sticker">
      <button onClick={() => setIsMenuOpen(!isMenuOpen)}>&#9776;</button>
      <div className={`menu ${isMenuOpen ? 'open' : ''}`}>
        <h5 className="logo">Mi Logo</h5>
        {['inicio', 'servicio', 'trabajo', 'contacto'].map(item => (
          <a key={item} href={`#${item}`} onClick={smoothScroll}>{item}</a>
        ))}
      </div>
    </nav>
  );
}

export default Navbar;
